import mongoose from 'mongoose'
import dotenv from 'dotenv'
import Movie from './models/movies.js'

dotenv.config()

mongoose.connect(process.env.DB_CONNECT_URI)
  .then(() => console.log('Conectado a MongoDB'))
  .catch(err => console.error('Error al conectar a MongoDB', err))

const populateMovies = async () => {
  try {
    await Movie.insertMany([
      {
        title: 'Resident Evil: Death Island',
        overview: 'Chris and Jill meet with Rebecca and Claire Redfield',
        release_date: '2023-06-22',
        popularity: 90.1,
        vote_average: 8.5,
        vote_count: 1500,
        poster_path: 'data:image/jpeg;base64,',
        original_language: 'en'
      },
      {
        title: 'Pretty Guardian Sailor Moon Eternal: The Movie',
        overview: 'A magical girl anime about Usagi Tsukino, who transforms into Sailor Moon to battle evil forces',
        release_date: '2022-06-03',
        popularity: 75.3,
        vote_average: 8.0,
        vote_count: 1200,
        poster_path: 'data:image/jpeg;base64,',
        original_language: 'ja'
      },
      {
        title: 'Resident Evil: Welcome to Raccoon City',
        overview: 'es una película de acción de zombis y horror ciencia ficción estadounidense-alemana dirigida por Johannes Roberts y escrita por Roberts y Greg Russo. Sirviendo como un reinicio de la serie de películas Resident Evil, que se basa en la serie de videojuegos del mismo nombre',
        release_date: '2021-11-21',
        popularity: 85.7,
        vote_average: 9.0,
        vote_count: 1800,
        poster_path: 'data:image/jpeg;base64,',
        original_language: 'en'
      }
    ])

    console.log('Películas insertadas con éxito')
  } catch (error) {
    console.error('Error al insertar películas:', error)
  } finally {
    await mongoose.disconnect()
  }
}

populateMovies()
